import "./Container.css";
import { useState, useEffect } from "react";
import Post from "../Post/Post";

function Container() {
  const [posts, setPosts] = useState([]);
  let current = [];

  useEffect(() => {
    fetch("https://restcountries.com/v3.1/all")
      .then((response) => response.json())
      .then((json) => setPosts(json));
  }, []);
  //console.log(posts);
  for (let i = 0; i < posts.length; i++) {
    let current_el = {
      id: i,
      //name: posts[i].translations.rus.common,
      //continent: posts[i].continents,
      //capital: posts[i].capital,
      //population: posts[i].population,
      //flag: posts[i].flags.svg,
      //map: posts[i].maps.googleMaps,
      //isLiked: false,
      //isDeleted: false,
      //note: "",
    };
    console.log(current_el);
    current[i] = current_el;
  }

  setPosts(current);

  return (
    <div className="main">
      {posts.map((el) => (
        <Post
          id={el.id}
          name={el.name}
          continent={el.continent}
          capital={el.capital}
          population={el.population}
          flag={el.flag}
          map={el.map}
        />
      ))}
    </div>
  );
}

export default Container;
